import React from 'react';
import Main from './components/Main';
import './App.css';
import About from './components/about';
import Contact from './components/contact';

function App() {

  return (
    <div className="App">
      <About/>
      <Contact/>
      <Main/>
    </div>
  );
}

export default App;
